import React, { useEffect, useState } from "react";
import Card from "../UI/Card";
import Dropdown from "../UI/Dropdown";
import Input from "../UI/Input";
import Button from "../UI/Button";
import instanceAxios from "../../api";

const AnswerForm = (props) => {
  const submitAnswerHandler = () => {};
  const [missions, setMissions] = useState("");
  useEffect(() => {
    instanceAxios.get("mission_type.json").then((response) => {
      console.log(response.data.missionTypes);

    });
  }, [props]);
  return (
    <>
      <form onSubmit={submitAnswerHandler}>
        <Card className="">
          <div className="grid grid-cols-6 gap-4 px-4 py-5 sm:p-6">
            <div className="col-span-6 sm:col-span-4">
              <div>
                {Array.isArray(missions) ? (
                  <Dropdown
                    label="Mission type"
                    onChange={submitAnswerHandler}
                    list={missions}
                    requiredField={true}
                  />
                ) : (
                  <></>
                )}
              </div>
            </div>
            <div className="col-span-6 sm:col-span-3">
              <Input
                labelContent="Quantité"
                type="text"
                name="quantity"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
            <div className="col-span-6 sm:col-span-3">
              <Input
                labelContent="VINs"
                type="text"
                name="vehicle_ids"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
            <div className="col-span-6 sm:col-span-6">
              <Input
                labelContent="Enlèvement"
                type="text"
                name="pick_up"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
            <div className="col-span-6 sm:col-span-6">
              <Input
                labelContent="Dépôt"
                type="text"
                name="drop_off"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
            <div className="col-span-6 sm:col-span-3">
              <Input
                labelContent="Flotte"
                type="text"
                name="fleet"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
            <div className="col-span-6 sm:col-span-6">
              <Input
                labelContent="Commentaire"
                type="text"
                name="comment"
                onChange={submitAnswerHandler}

                requiredField={true}
              ></Input>
            </div>
          </div>
          <div className="py-3 bg-gray-50 text-right px-2 sm:px-6">
            <Button type="submit">Add Mission</Button>
          </div>
        </Card>
      </form>
    </>
  );
};
export default AnswerForm;
